[mod-setting-description]
TS_base_shield=Capacité de départ du bouclier (50 - [200] - 10000)
TS_base_charge_rate=Taux de charge de départ du bouclier (1 - [20] - 1000)
TS_research_enabled=Avec cette option, vous devez faire des recherches sur les boucliers au lieu de les obtenir gratuitement\nPeut être activées ou non librement
TS_research_size=Le nombre d'étapes par ordre de grandeur dans la recherche sur la capacité du bouclier (100 - [5] - 1).
TS_research_speed=Le nombre d'étapes par ordre de grandeur dans la recherche sur le taux de charge du bouclier (100 - [5] - 1).
TS_alternate_effect=Remplace l'effet visuel du bouclier par une autre version animée.
TS_energy_consumption=Recharger les boucliers nécessite désormais de l'électricité
TS_energy_consumption_multiplier=Ici, vous pouvez fixer un multiplicateur pour le coût en énergie par impact. 1 = 1KJ/impact. \n(0,01 - [25,00] - 100,0)
TS_penalty=Lorsqu'il n'y a pas assez d'énergie disponible, les boucliers perdent le pourcentage donné de leur charge maximale par seconde.
TS_power_drain=Une valeur de 1 signifie ici une limite de 10k pour le bouclier, ce qui signifie une consommation de 100KW par bouclier. (0,1 - [10] - 50)
TS_max_research_level=Aide à éviter les échecs au démarrage en raison de l'atteinte de la limite d'identifiants par entité. Une valeur de 100 signifie ici que 100^2 ou 10 000 entités seront créées. Factorio a une limite de 65536 définitions d'entités. (5 - [25] - 100)
TS_compression_factor=S'il est réglé sur 50, un bouclier a la consommation d'énergie/la recharge/la limite/etc de 50 boucliers. ([1] - 1000)

